export default function Artwork() {
    const artworkText = ['In addition to my musical activities, I’m very interested in visual art and have been doing a lot of visual artwork myself over the years. This is a selection of my acrylic paintings created between 2005-2014.', <br />, 'The style is inspired by 60’s OpArt, but my main interest is a musical, “polyphonic” approach, with multiple, simultaneous motives layered on top of each other. Accordingly, I have been very interested in the direct integration between visuals and sound – which was a key motivation for my work with audio-visual digital projects.'];
    return (
        <div className="p-4 text-white bg-slate-700 text-center">
            {/*<h2 className="text-2xl font-bold">Artwork Section</h2>*/}
            <p> {artworkText}  </p>
            <img src="/images/Artwork/artwork1.jpg" alt="artwork1" className="p-1 w-1/2 h-auto" />
            <img src="/images/Artwork/artwork2.jpg" alt="artwork2" className="p-1 w-1/2 h-auto" />
            <img src="/images/Artwork/artwork3.jpg" alt="artwork3" className="p-1 w-1/2 h-auto" />
            <img src="/images/Artwork/artwork4.jpg" alt="artwork4" className="p-1 w-1/2 h-auto" />
            <img src="/images/Artwork/artwork5.jpg" alt="artwork5" className="p-1 w-1/2 h-auto" />
            <img src="/images/Artwork/artwork6.jpg" alt="artwork6" className="p-1 w-1/2 h-auto" />
            <img src="/images/Artwork/artwork7.jpg" alt="artwork7" className="p-1 w-1/2 h-auto" />
            <img src="/images/Artwork/artwork8.jpg" alt="artwork8" className="p-1 w-1/2 h-auto" />
            <img src="/images/Artwork/artwork9.jpg" alt="artwork9" className="p-1 w-1/2 h-auto" />        
        </div>
    );
}
